import styled from 'styled-components';
export const Container = styled.div`
    height: 100vh;
    width: 100vw;
    display: flex;
    justify-content: center;
    align-items: center;
`;

export const FormContainer = styled.div`
    background-color: black;
    width: 50%;
    height: 30%;
    border-radius: 20px;
`;

export const Title = styled.h1`
    color: white;
    
`;
